import { Component } from 'react';
import axios from 'axios';

class ListEstudiantes extends Component {

    state = {
        Pathfindees: [],
        PathfindeeRole: ''
    }
    componentDidMount() {
        this.getPathfindees();
    }

    getPathfindees = () => {
        axios.get('http://localhost:8080/api/tipoDocumento')
            .then(res => {
                this.setState({
                    Pathfindees: res.data.data,
                });
                console.log(this.state);
            });
    }
    handleChange = (e) => {
        this.setState({
            PathfindeeRole: e.target.value
        })
    }

    render() {
        return (
            <form className="Main-Wrapper">
                <div id="PathFinder-box">
                    <label>Path Finder:</label>
                    <label id="PathFinderName"><i>Path finder Name</i></label>
                </div>
                <div id="PathFindes-box">
                    <label>Path Findees:
                <select className="ComboBox" onChange={this.handleChange}>
                            {/*Listado de PathFindees*/}
                            {this.state.Pathfindees.map((PathFindee) => {
                                return (
                                    <option key={PathFindee.employeeid} value={PathFindee.rol}>{PathFindee.name}</option>
                                )
                            })
                            }
                        </select>
                    </label>
                    <div id="Role_Date-box">
                        <label>{this.state.PathfindeeRole}</label>
                        <label id="DateEvaluation_Title">Date of Evaluation:</label>
                    </div>
                </div>
            </form>
        );
    }
}
export default ListEstudiantes
